import { Nav, Navbar } from "react-bootstrap"
import { palett } from "../../../styles/theme";

const CustomNavbar = () =>{

    return(
        <>
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Navbar.Brand href="#home">Logo</Navbar.Brand>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">

                <Nav>
                    <Nav.Link href="#ingreso-simulador">Ingreso al simulador</Nav.Link>
                    <Nav.Link eventKey={2} href="#como-usar-simulador">
                        Cómo usar este simulador
                    </Nav.Link>
                    <Nav.Link eventKey={3} href="#preguntas-frecuentes">
                        Pregúntas frecuentes
                    </Nav.Link>
                    <Nav.Link eventKey={4} href="#contacto">
                        Contáctanos
                    </Nav.Link>
                </Nav>
            </Navbar.Collapse>
            </Navbar>
            <style jsx>
                {`
                    div {
                        width: 100%;
                    }
                    .nav-link.active{
                        color: red
                    }
                    // button:active {
                    //     border: solid 1px ${palett.white};
                    //     position:relative;
                    //     top:1px;
                    // }
                    // .btnRed {
                    //     background-color: ${palett.primary.main};
                    //     color: ${palett.white};
                    // }
                    // .btnRed:hover {
                    //     background-color: ${palett.primary.light};
                    // }
                    // .btnWhite {
                    //     background-color: ${palett.white};
                    //     color: ${palett.text.btn.dark};
                    // }
                    // .btnWhite:hover {
                    //     background-color: #f5f5f5;
                    // }
                `}
            </style>
        </>
    )
}

export default CustomNavbar;
